import React from "react";

function MoviesCard({movies}) {
  console.log(movies.nameRU)
  return (

      <div className='movieCard'>
        <img
          className='movieCard__image'
          src='/pic__COLOR_pic.png'
          alt='film'
        ></img>
        <div className='movieCard__text'>
          <h3 className='movieCard__title'>{movies.nameRU
}</h3>
          <p className='movieCard__duration'>{movies.duration}</p>
        </div>
      </div>


  );
}

export default MoviesCard;
